YF360D series is a versatile, easy-to-deploy, rugged and reliable VPN gateway designed for harsh environment, providing seamless, secure, fast wireless connectivity to M2M/IoT applications.


Dual SIM Industrial Cellular VPN Router with 4 Ethernet ports;

GPRS/EDGE/UMTS/HSPA/EVDO/4G LTE Networks;

Supports Centralized M2M management platform;

Supports GPS (optional), provides real time location/ tracking;

Supports 802.11 b/g/n Wi-Fi, AP and client mode.

Various interfaces: RS232/RS485/Console/Ethernet.
